import "./App.css";
import ChapterList from "./components/chapterList/ChapterList";
import Intro from "./components/Intro";
function App() {
  return (
    <div className="container">
      <div className="row">
        <Intro />
      </div>
      <div className="row">
        <ChapterList />
      </div>
    </div>
  );
}

export default App;
